    "Improved Understanding of Space Radiation Effects on Exploration Electronics by
    Advanced Modeling of Nanoscale Devices and Novel Materials Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:36:56.792955",nt"name": "improved-understanding-of-space-radiation-effects-on-exploration-electronics-by-advanced-m",nt"isopen":
    true,nt"url": null,nt"notes": "Future NASA space exploration missions will
    use nanometer-scale electronic technologies which call for a shift in how radiation
    effects in such devices and materials are viewed. The energy deposition by ionizing
    particles (so called single event effects) can no longer be treated as an average
    deposition (linear energy transfer, LET). Nano-scale electronic device responses
    are strongly related to the microstructure of the radiation event. This requires
    a much more detailed physics-based modeling approach. It is also important to convert
    such results into engineering models used in device and circuit designs. Hence,
    the proposed innovation: detailed high-energy-physics-based simulations of radiation
    events efficiently coupled with advanced device response computations. The innovative
    Technology Transfer: interface specification and implementation to allow smooth,
    automated integration between Vanderbilt University high-energy particle advanced
    computations and CFDRC Device Simulator, and to enable statistically meaningful
    runs on a massively parallel supercomputing cluster. Significance for NASA:  the
    impact of such radiation events has implications for nano-scale devices operating
    in space exploration environments. The new approach to understanding the single-event
    response of semiconductor materials, devices, and circuits is necessary for reliable
    engineering models used for early design assessment, radiation hardening, and to
    reduce the amount of radiation testing cost and time.",nt"license_title": "U.S.
